    const userEmail = user.Email;
    const transcriptRef = data ? ref(dbStorage, `transcripts/${data.LName + '_transcript'}`) : null;

  
    useEffect(() => {
      // Retrieve user data from local storage if available
      const storedUserData = localStorage.getItem('userData');
      if (storedUserData) {
        setData(JSON.parse(storedUserData));
      } else {
        // Fetch user data from Firestore and save to local storage
        db.collection('profile').doc(userEmail).get()
          .then(doc => {
            if (doc.exists) {
              setData(doc.data());
              localStorage.setItem('userData', JSON.stringify(doc.data()));
            } else {
              console.log('No such document!');
            }
